typedef struct {
    uint32_t H[8];           // Current hash state
    uint8_t  buf[64];        // 512-bit message buffer
    uint32_t buf_len;        // Bytes in buffer (0-63)
    uint32_t padding;        // Alignment padding
    uint64_t msg_len_bits;   // Total message bits
} SHA256_CTX;
